void GJBaseGameLayer::setStartPosObject(StartPosObject* startPos) {
		if (startPos != m_startPosObject) {
			if (startPos) {
				startPos->retain();
			}
			if (m_startPosObject) {
				m_startPosObject->release();
			}
			m_startPosObject = startPos;
		}
	}

